        aritst: 'artist3', 
        album: 'album3', 
        id: 3}
    ]
    };
  };
  render() {
    return (
      <div>
      <h1>Ja<span className="highlight">mmm</span>ing</h1>
        <div className="App">
        <SearchBar />
          <div className="App-playlist">
            <SearchResults flange={this.state.searchResults}/>
            <Playlist />
          </div>
        </div>
      </div>
    )
  };
};



export default App;
